import React, { Fragment } from 'react';

const Header = (props) => {
  return (
    <Fragment>
      <div id="Header">
      </div>
      <style jsx>
        {`
          *{
            padding: 0;
            margin: 0;
          }
        `}
      </style>
    </Fragment>
  );
};

export default Header;
